nged fields: ', offstage_field_changes, stage_field_changes);\n}\n\n// setup change_type icons\nswitch (change.get('change_type')) {\n    case 'added':\n\t    w.find('.added').show();\n        break;\n    case 'deleted':\n\t    w.find('.deleted').show();\n        break;\n    case 'modified':\n\t    w.find('.modified').show();\n        break;\n    case 'tracked':\n\t    w.find('.tracked').show();\n        break;\n    default:\n        console.log('UNKNOWN CHANGE TYPE: '+change.get('change_type'));\n        break;\n}\n\n// stage button\nw.find('button.stage').click(function() {\n    switch(change_type) {\n        case 'added':\n\t\t    endpoint.schema('bundle').function('stage_row_add', [\n                bundle.get('name'),\n                schema_name,\n                relation_name,\n                pk_column_name,\n                pk_value\n            ]).then(function() {\n                reload();\n            }).catch(function(e) {\n                console.error(e);\n            });\n            break;\n        case 'deleted':\n\t\t    endpoint.schema('bundle').function('stage_row_delete', [\n                bundle.get('name'),\n                schema_name,\n                relation_name,\n                pk_column_name,\n                pk_value\n            ]).then(function() {\n                reload();\n            }).catch(function(e) {\n                console.error(e);\n            });\n            break;\n        case 'tracked':\n\t\t    endpoint.schema('bundle').function('stage_row_add', [\n                bundle.get('name'),\n                schema_name,\n                relation_name,\n                pk_column_name,\n                pk_value\n            ]).then(function() {\n                reload();\n            }).catch(function(e) {\n                console.error(e);\n            });\n            break;\n        case 'modified':\n            console.log('not implemented yet', change);\n            break;\n        default:\n            console.er