/////\n// show all\n/////////////////////////////////////////////////////////////////////\n\nw.find('div.show_all').bind('mouseover', function(e) {\n    $("[data-widget]").addClass('debugger3_widget_highlight');\n    e.stopPropagation();    \n}).bind('mouseout', function(e) {\n    $("[data-widget]").removeClass('debugger3_widget_highlight');\n    e.stopPropagation();\n});\n\n\n\n\n/////////////////////////////////////////////////////////////////////\n// new_widget\n/////////////////////////////////////////////////////////////////////\n\nw.find('.new_widget').click(function() {\n    w.append(widget('modal_overlay', { \n        content: widget ('widget_new', { \n            widget_table: endpoint.schema('widget').table('widget') \n        })\n    }));\n});
